import { useState } from 'react'
import axios from "axios";
import logo from './logo.svg';
import './App.css';

function App() {

   // new line start


  async function fetchData()
  {
    let json = await (await fetch("http://chrissytopher.com:5000/profile")).json();
    console.log(json);
  }
    //end of new line 

  return (
    <div className="App">
      <header className="App-header">

        <p>To get your profile details: </p><button onClick={fetchData}>Click me</button>

      </header>
    </div>
  );
}

export default App;
